        /// 实际结束时间
        /// 注意：此字段可能返回 null，表示取不到有效值。
        public let realEndTime: UInt64?

        /// 分辨率。1 标清
        /// 2 高清
        /// 3 全高清
        /// 注意：此字段可能返回 null，表示取不到有效值。
        public let resolution: UInt64?

        /// 最大允许连麦人数
