        /// 最高房间内人数（不包括老师），0表示不限制，默认为0
        /// 注意：此字段可能返回 null，表示取不到有效值。
        public let maxMicNumber: UInt64?

        /// 打开学生麦克风/摄像头的授权开关
        /// 注意：此字段可能返回 null，表示取不到有效值。
